DROP TABLE IF EXISTS `maple_account`;
CREATE TABLE `maple_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `driver_id` int(11) DEFAULT NULL,
  `name` varchar(50) DEFAULT NULL COMMENT '账户姓名',
  `platform` int(4) DEFAULT NULL COMMENT '平台代码：1-支付宝，4-平安银行,3-建设银行',
  `account` varchar(100) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `driver_id_index` (`driver_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;

